window.bookSummaryJSON = "<p><b>This title will be streaming in Audible Plus through September 1st, 2021. </b></p> <p>With his duel fast approaching, Lindon is locked away in prison.&nbsp;&nbsp;&nbsp;</p> <p>As a Blackflame, he is too dangerous to remain free. The Skysworn, protectors of the Empire, have imprisoned him to keep him under control until the day of his promised fight arrives. <br> When it does, he will face Jai Long.&nbsp;&nbsp;&nbsp;</p> <p>But a new danger approaches the Empire, closer every day. One of the Dreadgods stirs, earlier than predicted, and even a brush with such a creature could be the end of the Blackflame Empire. Only the Skysworn stand between the people of the land and total annihilation.&nbsp;&nbsp;&nbsp;</p> <p>And Lindon may be forced to join them.&nbsp;&nbsp;</p>"; 
